					return net.brehaut.Color(this.hairLight).darkenByRatio(0.2).toCSS()
				},
				hairBlockDark(){
					return net.brehaut.Color(this.hairLight).lightenByRatio(0.3).toCSS()
				},
				hairBlockLight(){
					return net.brehaut.Color(this.hairLight).lightenByRatio(0.5).toCSS()
				},
				clothDark(){
					return net.brehaut.Color(this.clothLight).darkenByRatio(0.1).toCSS()
				},
				clothLine(){
					return net.brehaut.Color(this.clothLight).darkenByRatio(0.2).toCSS()
				},
				imgUrl(){
					return this.pastedUrl!==""?this.pastedUrl:this.imgLists[this.imgIndex].url
				}
			},
			updated(){
				this.setViewer()//new Viewer(document.querySelector(".stage"),{zoomRatio:0.3})
			},
			methods:{
				converImage(){
					html2canvas(document.querySelector(".box"),{
  						backgroundColor: null // null或transparent可将canvas背景设置为透明
					}).then(canvas => {
						let url = canvas.toDataURL()
						/*window.open(url)*/
						this.generatedImgs.push(url)
						
						//const img = new Image();
						//img.src = url;
						//const newWin = window.open("", "_blank");
						//newWin.document.write(img.outerHTML);
						//newWin.document.title = "卡通形象"
						//newWin.document.close();
						//window.open data:/为何打不开
					    //document.body.appendChild(canvas)
					});
				},
				downloadSvg(){
				    var content = document.querySelector("svg").outerHTML,
				        blob = new Blob([content],{type : 'text/html'});
				    this.download = "卡通形象"+new Date().getTime()+".svg"
				    this.href = window.URL.createObjectURL(blob)
				},
				setViewer(){
					if(this.viewer!==null){
					    this.viewer.destroy()
					}
					this.viewer = new Viewer(document.querySelector(".stage"),{zoomRatio:0.3})
				}
			},
		})
	</script>
